import React from 'react';
import './Operators.scss';

const Operators = () => {
  return (
    <div className="col-3 operators">
      <button>&divide;</button>
      <button>&times;</button>
      <button>&#45;</button>
      <button>&#43;</button>
      <button className="equal">&#61;</button>
    </div>
  )
}

export default Operators;
